css:
@-moz-document domain("postnl.post") {
body {background-color: #282828 !important;}
.carousel-inner, .carousel-inner .item, .carousel-inner .item.active, .carousel-inner .item.active img {height: 0px !important;}
.textareawrapper {background-color: #3E3E3E !important; box-shadow: none !IMportant; border: none !important; color: #cacaca !important;}
.textareawrapper textarea {color: #cacaca !important;}
.content>h2:first-child {    color: #ed8c00 !important;}
.swoosh {background-image: none !important;background-color: #282828 !important;}
.trackandtrace-table-wrapper tfoot, .trackandtrace-table-wrapper tfoot tr {background: #282828 !important;}
tr {border:none !Important;}
.table-wrapper {    border-bottom: 5px solid #282828 !important;}
.trackandtrace-table-wrapper tfoot tr td {border:none !Important;}
.trackandtrace-table-wrapper thead {
    background-color: #407AB5 !important;}
.table-wrapper .trackandtrace-table-wrapper tbody tr {    background-color: #282828 !important; color:#cacaca !Important;}
.trackandtrace-table-wrapper tbody td {border:none !Important;}
.trackandtrace-table-wrapper thead tr.subheading td {background-color: #282828 !important;}
.delivery-details-image img {height: 0 !IMportant;}
.trackandtrace-table-wrapper tbody, .trackandtrace-table-wrapper tfoot {border:none !Important;}
.trackandtrace-table-wrapper tfoot td.summary .progress {background-color: #282828 !important;   border: 1px solid #282828 !important;}
.green, .green-multi {    background:#FBB51B  !important;}
.progress-wrap {background:#407AB5 !important;border-radius:4px !important;}
.trackandtrace-table-wrapper tfoot td.summary > div {color: #cacaca !important;}
}
